import Login from "./Login";
import "../../style/Main.scss";

export default function Main({ server_url }) {
  return (
    <div className="desktop1">
      <div className="bg1">
        <div className="frame2Default">
          <div className="logo"></div>
        </div>
      </div>
      <Login></Login>
    </div>
  );
}
